    "7331501": {
        "Desc": "",
        "Talk": []
    },
    "7331502": {
        "Desc": "",
        "Talk": [
            [
                {
                    "N": "Sorush",
                    "T": "Así que este es el aspecto que tienen... Es verdaderamente lamentable."
                },
                {
                    "N": "_1005",
                    "T": "¿Eh? ¿De qué hablas, Sorush?"
                },
                {
                    "N": "Sorush",
                    "T": "No es nada. Simplemente, acabo de presenciar el lamentable final de algunas miembros de mi estirpe. Nada del otro mundo."
                },
                {
                    "N": "_1005",
                    "T": "¡Si lo dices así, suena bastante preocupante!"
                },
                {
                    "N": "_1005",
                    "T": "¡Deja que Paimon lo vea! ¿Eh? Vaya árbol más raro, ¿no? Tiene forma como de puerta."
                },
                {
                    "N": "_0",
                    "T": "¿Y si lo atravesamos?"
                },
                {
                    "N": "_0",
                    "T": "Tal vez conduzca a algún lugar."
                },
                {
                    "N": "_1005",
                    "T": "¡Jeje, suena divertido! ¡Paimon, prímer!"
                },
                {
                    "N": "Sorush",
                    "T": "Los árboles fravashi no son puertas. No puedes entrar sin más, molestarías a las pari que moran en su interior."
                },
                {
                    "N": "_1005",
                    "T": "Así que esto es un árbol fravashi... ¿Y dónde están esas pari? Paimon no las ve por ningún lado."
                },
                {
                    "N": "Sorush",
                    "T": "Pues claro que no puedes verlas, paliducha flotante. Después de todo, están atrapadas en sus obsesiones del pasado."
                },
                {
                    "N": "Sorush",
                    "T": "Puede que no sea lo que ellas deseen, pero verlas aferrarse a la vida de esta manera es... realmente desalentador."
                },
                {
                    "N": "_1005",
                    "T": "Pues a Paimon le parece un árbol muy frondoso, ¿no crees?"
                },
                {
                    "N": "Sorush",
                    "T": "¡Bah! ¿Y qué sabrás tú, paliducha flotante? Tanto los árboles fravashi como las pari que moran en su interior lucharon por resistir la ponzoña que los consume. Han agotado sus últimas fuerzas en el intento y por eso tienen este aspecto."
                },
                {
                    "N": "Sorush",
                    "T": "Se han consumido hasta tal punto que ya no son capaces de mantener su forma original. Han sido rechazadas en el Piélago Floral por la inmundicia que acarrean."
                },
                {
                    "N": "Sorush",
                    "T": "Según las leyendas, antiguamente, la Orden de los Escépticos celebraba un ritual de purificación para poder llevar sus almas de vuelta al Piélago."
                },
                {
                    "N": "Sorush",
                    "T": "Por desgracia, no queda ningún miembro de la Orden capaz de llevar a cabo el ritual. Ahora, lo único que se puede hacer es mantener los árboles con vida."
                },
                {
                    "N": "Sorush",
                    "T": "Aunque por su aspecto diría que solo están prolongando su sufrimiento. No creo que les queden más que tormentosos recuerdos de su vida pasada."
                },
                {
                    "N": "_0",
                    "T": "Deberíamos ayudarlas."
                },
                {
                    "N": "_0",
                    "T": "Entonces, hay una forma de salvarlas."
                },
                {
                    "N": "_1005",
                    "T": "¡Eso! ¡No podemos dejar que sigan sufriendo! ¡Le parte el corazón a Paimon!"
                },
                {
                    "N": "Sorush",
                    "T": "Aunque comparto el sentimiento, este es precisamente nuestro destino. Tal vez aún desean permanecer aquí, custodiando el lugar."
                },
                {
                    "N": "_1005",
                    "T": "¡¿Eh?! ¡Eso es lo que tú crees, pero tal vez ellas ya no quieran seguir aquí!"
                },
                {
                    "N": "_1005",
                    "T": "Si Paimon estuviera ahí dentro, atrapada y sufriendo, seguro que estaría deseando volver a casa con sus seres queridos..."
                },
                {
                    "N": "Sorush",
                    "T": "¡No subestimes nuestra tenacidad, paliducha flotante!"
                },
                {
                    "N": "Sorush",
                    "T": "Bah, está bien. Las despertaré para que puedan escuchar su voz."
                }
            ]
        ]
    },
